import React from "react";
import "./navbarplaceholder.css";

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <ul id="nav">
          <li>
            <h2>MINERVA MENTORSHIP</h2>
          </li>
          <li>
            <h3>HOME</h3>
          </li>
          <li>
            <h3>BIOS</h3>
          </li>
          <li>
            <h3>MENTORS</h3>
          </li>
          <li>
            <h3>BECOME A MENTOR</h3>
          </li>
          <li>
            <h3>BECOME A MENTEE</h3>
          </li>
        </ul>
      </div>
    );
  }
}

export default Navbar;
